Camp Rock (2008)

Verenigde Staten
Komedie / Muziek
94 minuten

geregisseerd door Matthew Diamond
met Demi Lovato, Joe Jonas en Alyson Stoner

Een tienermeisje wil dolgraag haar zomer doorbrengen op een prestigieus rockkamp. Ze kan deze alleen bijwonen wanneer ze als kok werkt in de keuken. Als ze op een avond in haar eentje zingt, hoort de popidool Shane Gray dit. Al snel probeert hij erachter te komen wie het meisje is achter deze prachtige stem. Voordat ze haar plek in het spotlicht kan nemen, moet ze eerst haar angsten confronteren.



